import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// @material-ui/icons
import {Map,Marker,Popup,TileLayer}from "react-leaflet";
import {Icon, tileLayer} from "leaflet";
import "./map.css";
//maps components
// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import HeaderLinks from "components/Header/HeaderLinks.js";
import useSwr from "swr"


import styles from "assets/jss/material-kit-react/views/landingPage.js";

const fetcher =(...args) => fetch(...args).then(response => response.json());
const dashboardRoutes = [];

const useStyles = makeStyles(styles);

export default function LandingPage(props) {
  const pagina = "https://jsonplaceholder.typicode.com/users";
  const {data,error} = useSwr(pagina,{ fetcher });
  const notarias = data && !error ? data :null;
  const classes = useStyles();
  const { ...rest } = props;
  return (
    <div>
      <div>
      <Header
        absolute
        color="white"
        brand="Arma Tu Fiesta"
        rightLinks={<HeaderLinks />}
        {...rest}
      />
      </div>
      <div className={classNames(classes.main, classes.main)}>
        <div className={classes.container}>
        <Map center={[10.48801,-66.87919]} zoom={8}>
        
        <TileLayer
          attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
        {notarias.Map( notarias => (
          <Marker
          key={notarias.id}
          position={[notarias.address.geo.lat,notarias.address.geo.lng]}>

          </Marker>


        ))}
        </Map>
        </div>
      </div>
      <Footer />
    </div>
  );
}
